//import logo from './logo.svg';
import logo_main from './log_logo.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo_main} width="20%" alt="Main Logo"/>
      </header>
    </div>
  );
}

export default App;
